package week1.day2;

public class LearnJumpStatement {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		for(int i=0;i<=15;i++)
		{
			if (i==9)
			{
				break;
			}
			else if (i==7)
			{
				continue;
			}
			else
			System.out.println(i);

		}

	}

}
